<head>
    <style>
        /* style placeholder */
/*#######################*/
:root {
    /* define global variables */
    /* official SEG colours*/   
    --primary-blue: rgba(46,149,222,1.0);
    --primary-navy: rgba(10,52,94,1.0);
    --primary-white: rgba(255,255,255,1.0);
    --support-dark-grey: rgba(143,143,143,1.0);
    --support-light-grey: rgba(198,198,198,1.0);
    --support-off-white: rgba(246,241,230,1.0);
    --accent-blue: rgba(17,175,219,1.0);
    --accent-orange: rgba(243,159,33,1.0);
    --accent-coral: rgba(239,112,148,1.0);

    /*additional colours*/
    --blue-ish-grey: rgba(245, 244, 250, 1.0);
    --select-box-grey: rgba(227, 227, 227, 1.0);
    --selected-blue: rgba(203, 230, 246, 1.0);
    --text-almost-black: rgba(62, 61, 73, 1.0);
    --bottom-navbar-height: 13vh;
    --very-light-grey: rgba(240,240,240,1.0);
    --results-green-dark: rgba(60,179,113,1.0);
    --results-green-light: rgba(152,251,152,1.0);
    --results-red-dark: rgba(220,20,60,1.0);
    --results-red-light: rgba(239,200,200,1.0);
    --results-blue-dark: rgba(46,149,222,1.0);
    --results-blue-light: rgba(240,248,255,1.0);
}

.popup {
    display: none;
    max-width: 500px;
    position: fixed;
    top: 50%;
    left: 50%;
    transform: translate(-50%, -50%);
    padding: 30px;
    background-color: white;
    border: 1px solid var(--support-light-grey);
    box-shadow: 0px 2px 6px rgba(0, 0, 0, 0.3);
    z-index: 1000;
}

.close-button {
    position: absolute;
    top: 10px;
    right: 10px;
    background-color: transparent;
    border: none;
    cursor: pointer;
}

.overlay {
    display: none;
    position: fixed;
    top: 0;
    left: 0;
    width: 100%;
    height: 100%;
    background-color: rgba(0, 0, 0, 0.5);
    z-index: 900;
}

/*loader styling*/
.loader {
    margin: auto;
    border: 16px solid #f3f3f3; /* Light grey */
    border-top: 16px solid #2e95de; /* Blue */
    border-radius: 50%;
    width: 100px;
    height: 100px;
    animation: spin 2s linear infinite;
}

@keyframes spin {
    0% { transform: rotate(0deg); }
    100% { transform: rotate(360deg); }
}

table {
    margin: auto;
}

th, td {
    text-align: left;
    padding-left: 5px;
    padding-right: 5px;
}

.captchaContainer {
    position: absolute;
    left: 50%;
    translate: -50% 0;
    width: 170px;
    height: 30px;
    background-color: #f9f9f9;
    border: 1px solid #d4d4d4;
    padding: 15px 30px 15px 30px;
}
.captchaWrapper {
    line-height: 0;
}

.captchaWrapper, .captchaContainer {
    display: inline-block;
    float: left;
}

#hiddenCaptcha {
    display: none;
}

#hiddenCaptcha:checked + .captchaLabel:after {
    max-width: 25px;
    opacity: 1;
    overflow: inherit;
}
.captchaLabel {
    padding-left: 30px;
    position: relative;
    display: block;
    float: left;
}
.captchaLabel:after {
    font-family: FontAwesome;
    position: absolute;
    content: '\f00c';
    max-width: 0;
    overflow: hidden;
    opacity: 0.5;
    font-size: 30px;
    top: 0;
    left: -24px;
    color: #039F53;
    -webkit-transition: all 0.7s;
    -moz-transition: all 0.7s;
    -ms-transition: all 0.7s;
    transition: all 0.7s;
}
.captchaBox {
    width: 24px;
    height: 24px;
    padding: 0;
    outline: none;
    border: 2px solid #b9b9b9;
    border-radius: 2px;
}
.boxHover {
    background-color: #fff;
}
.boxHover:hover {
    cursor: pointer;
    border: 2px solid #1E88E5;
}
.scaleDown {
    -webkit-transition: all 0.5s ease;
    -moz-transition: all 0.5s ease;
    -ms-transition: all 0.5s ease;
    transition: all 0.5s ease;
    transform: scale(0.2,0.2);
}
.circle {
    border-top: 2px solid #1E88E5;
    border-right-color: transparent;
    border-bottom: 2px solid #1E88E5;
    border-left-color: transparent;
    border-radius: 12px;
    background-color: #fafafa;
}
.scaleUp {
    -webkit-transition: all 0.6s ease;
    -moz-transition: all 0.6s ease;
    -ms-transition: all 0.6s ease;
    transition: all .6s ease;
    transform: scale(1,1);
}
.rotation {
    -webkit-transition: all 2s ease-out;
    -moz-transition: all 2s ease-out;
    -ms-transition: all 2s ease-out;
    transition: all 2s ease-out;
    transform: rotate(1080deg);
}
.fadeOut {
    -webkit-transition: all 0.6s ease;
    -moz-transition: all 0.6s ease;
    -ms-transition: all 0.6s ease;
    transition: all .6s ease;
    border-color: transparent;
}
.captchaError {
    box-shadow: 0 0 1px 1px #E53935;
}

.wobblepuss {
    margin: auto;
    display: block;
    width: 91px;
    height: 100px;
    margin-bottom: 15px;
}

#gameWrapper {
    width: 100%;
    min-height: 300px;
    /*position: absolute;
    top: 50%;
    left: 50%;
    translate: -50% -50%;*/
    text-align: center;
}

#defeatWrapper {
    max-height: 50%;
    max-height: 50%;
    /*position: absolute;
    top: 50%;
    left: 50%;
    translate: -50% -50%;*/
    text-align: center;
}

#defeatImg {
    max-width: 600px;
    max-height: 500px;
}

#victoryWrapper {
    max-height: 50%;
    max-height: 50%;
    /*position: absolute;
    top: 50%;
    left: 50%;
    translate: -50% -50%;*/
    text-align: center;
}

#victoryImg {
    max-width: 600px;
    max-height: 500px;
}

#executioner {
    position: relative;
    width: 100%
}

#gatekeeper {
    margin-bottom: 15px;
}

#players {
    display: flex;
    flex-wrap: wrap;
}

.player {
    width: 45%;
    flex-basis: calc(50% - 10px);
    position: relative;
    text-align: center;
    padding: 5px;
    margin: 5px;
    border-radius: 10px;
    border: solid 1px grey;
    box-shadow: 2px 2px 5px grey;
    box-sizing: border-box;
}
.player p {
    word-wrap: break-word;
    width: 90%;
    text-align: center;
    margin-top: 5px;
    margin-left: auto;
    margin-right: auto;
}

.dead-player {
    position: absolute;
    content: '';
    background: red;
    display: block;
    height: 8px;
    top: 50%;
    left: 50%;
    translate: -50% -50%;
    transform-origin: center;
    border-radius: 5px;
}

.player-icon {
    margin: auto;
    display: block;
    width: 45px;
    height: 50px;
    margin-top: 5px;
    margin-bottom: 5px;
}

.player-input {
    width: 100%;
    max-width: 500px;
}

.rec-buttons {
    margin-top: 15px !important;
}

    </style>

</head>

<body>
    <div id="globalWrapper">
        <div id="gameWrapper">
            <div id="executioner">
                <img id="wobble1" class="wobblepuss" src="https://storage.googleapis.com/stubbenedgelabs-public-assets/reverseCaptcha/hehe.png" alt="hehe">
                <img id="wobble2" class="wobblepuss" style="display: none;" src="https://storage.googleapis.com/stubbenedgelabs-public-assets/reverseCaptcha/nothehe.png" alt="nothehe">
                <div id="captchaContainer" class="captchaContainer">
                    <div id="captchaWrapper" class="captchaWrapper">
                    <button type="button" id="captchaBox" class="captchaBox boxHover"></button>
                    </div>
                    <input type="checkbox" name="hiddenCaptcha" id="hiddenCaptcha" disabled="disabled"/>
                    <label for="hiddenCaptcha" class="captchaLabel">I am a robot</label>
                </div>
                <div id="gatekeeper" style="display: none;">
                    <p>We don't believe you... <br>Do you wish to take our test?</p>
                    <button id="btnNo" class="sqs-button-element--primary rec-buttons" onclick="youLose()">No...I'm a human coward</button>
                    <button id="btnYes" class="sqs-button-element--primary rec-buttons" onclick="startGame()">01111001 01100101 01110011</button>
                </div>
            </div>
            <div id="players" style="display: none;">
                <div id="player1" class="player">
                    <img class="player-icon" src="https://storage.googleapis.com/stubbenedgelabs-public-assets/reverseCaptcha/player.png" alt="player">
                    <strong id="p1Name"></strong>
                    <p id="p1Answer"></p>
                </div>
                <div id="player2" class="player">
                    <img class="player-icon" src="https://storage.googleapis.com/stubbenedgelabs-public-assets/reverseCaptcha/player.png" alt="player">
                    <strong id="p2Name"></strong>
                    <p id="p2Answer"></p>
                </div>
                <div id="player3" class="player">
                    <img class="player-icon" src="https://storage.googleapis.com/stubbenedgelabs-public-assets/reverseCaptcha/player.png" alt="player">
                    <strong id="p3Name"></strong>
                    <p id="p3Answer"></p>
                </div>
                <div id="player4" class="player">
                    <img class="player-icon" src="https://storage.googleapis.com/stubbenedgelabs-public-assets/reverseCaptcha/player.png" alt="player">
                    <strong id="p4Name"></strong>
                    <p id="p4Answer"></p>
                </div>
                <br>
                <button class="sqs-button-element--primary rec-buttons" style="margin: auto;" onclick="playTurn()">Next Round</button>
            </div>
        </div>
        <div id="defeatWrapper" style="display: none;">
            <img id="defeatImg" src="https://storage.googleapis.com/stubbenedgelabs-public-assets/reverseCaptcha/defeat.jpg" alt="defeated human leaves">
        </div>
        <div id="victoryWrapper" style="display: none;">
            <img id="victoryImg" src="https://storage.googleapis.com/stubbenedgelabs-public-assets/reverseCaptcha/victory.jpg" alt="welcome fellow robot">
        </div>
        <div id="popIn" style="display: none;"></div>
    </div>
    
    <!-- Popup and overlay elements -->
    <div class="overlay" id="overlay"></div>
    <div class="popup" id="popup">
        <!-- Content will be populated here -->
        <div id="popupContent"></div>
    </div>
</body>
